const scene = new Scene({
  id: 'map',
  map: new GaodeMap({
    center: [ 120.15, 30.246 ],
    zoom: 11,
    style: 'light',
    pitchEnable: false
  })
});
scene.on('loaded', () => {
  const plane = initPlane();
      const pointLayer = new HeatmapLayer({})
        .source(data,{transforms: [
                          {
                            type: 'grid',
                            size: 500,
                            field: 'v',
                            method: 'max',
                          },
                        ],})
        .shape('circle')
        .size('mag', [3, 6, 9, 12, 15 ])
        .active(false)
        .style({
          coverage: 0.9,
          angle: 0,
          opacity: 0.5,
        })
        .color('count', ['#002466','#105CB3','#FFF5B8']);
      scene.addLayer(pointLayer);
      pointLayer.on('click', e => {
        const { lng, lat } = e.lngLat;
        scene.setCenter([ lng, lat ], {
          padding: {
            right: 120
          }
        });
        plane.style.right = '0px';
        plane.innerHTML = `
          <p>click info</>
          <p>featureId: ${e.featureId}</p>
          <p>lng: ${lng}</p>
          <p>lat: ${lat}</p>
        `;
      });
      pointLayer.on('unclick', () => {
        plane.style.right = '-120px';
        scene.setCenter([ 140.067171, 36.26186 ], {
          padding: {
            right: 0
          }
        });
      });
});

function initPlane() {
  const el = document.createElement('div');
  el.style.background = '#fff';
  el.style.position = 'absolute';
  el.style.padding = '10px';
  el.style.top = '0';
  el.style.right = '-120px';
  el.style.width = '100px';
  el.style.height = '100%';
  el.style.zIndex = '10';
  el.style.transition = '0.5s';
  // el.innerText = '123'
  const wrap = document.getElementById('map');
  wrap.appendChild(el);
  return el;
}
